  const [error, setError] = useState(false);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const getProducts = async () => {
      setLoading(true);
      try {
        const res = await axios.get("/api/inventory");
        console.log(res);
        setProducts(res.data);
      } catch (error) {
        setError(true);
      }
      setLoading(false);
    };
    getProducts();
